/* eslint-disable jsx-a11y/alt-text */
import React from "react";
import classnames from "classnames";

/**
 * Use with the `Chip` `contact` prop to add a contact image to a chip.
 */
const ChipContactImage = ({ className, ...other }) => (
  <img className={classnames("cdk-chip__contact", className)} {...other} />
);

export default ChipContactImage;
